        <div className='conteudo-centralizado'>
            <h3>Número aleatório:</h3>
            <h1>0</h1>

            <div className='area-botao'>
                <label>
                    Click no botão abaixo para gerar um número aleatório: 
                </label>
            </div>
        </div>
    );
}
